import React from 'react';
import PropTypes from 'prop-types';
import terraImg from '../images/Terra.png';
import luaImg from '../images/Lua.png';

class Terra extends React.Component {
  render() {
    const { name,
      image,
      sateliteNatural,
      sateliteImg } = this.props;
    return (
      <div className="Terra">
        <p data-testid="planet-name">Terra</p>
        <img
          src={ terraImg }
          alt="Planeta Terra"
          id="Terra"
        />
        <img
          src={ luaImg }
          alt="Lua"
          id="Lua"
        />
      </div>
    );
  }
}

Terra.propTypes = {
  name: PropTypes.string.isRequired,
  image: PropTypes.string.isRequired,
  sateliteNatural: PropTypes.string.isRequired,
  sateliteImg: PropTypes.string.isRequired,
};

export default Terra;
